■フロントダウン(MM)：30～35 ■リアダウン(MM)：30～35 ■フロントレート：3.4  ■リアレート：6.8 ■品番：SH038A　※バンプラバーのカットが必要です。（商品にカット表添付）　※3年間5万キロ保証（保証規定の詳細はメーカーサイトにてご確認ください）　※2016年12月31日までキャンペーン特価での販売となっております。<br><br>■ダウンＭＭの数値は代表車種で測定したものです。車種によっては多少の誤差がありますので、あくまで目安としてお考え下さい。【稀にお車の最低地上高が測定値と異なる場合がございます。予め最低地上高をご確認の上、表記ダウン量で問題がないか判断してください】　■ディーラーオプションにてローダウン仕様の車があります。その場合ダウン量が上記表記と変わってきますのでご注意ください。　■車両のマイナーチェンジ（同一型式）においても、標準でローダウン仕様になる車があります。その場合ダウン量が表記と変わってきますのでご注意ください。　■商品の材質、仕様、ダウンＭＭ及び価格等は、予告なく変更することがあります。<br><br>■マッチング車両は全て、純正タイヤ（サマータイヤ）、純正ショックアブソーバーでのマッチングデータになります。これらが社外品と交換されていた場合、適合表のダウン量と異なったり、車両部位と干渉したり、異音を発生したり、車検不適合となる可能性がありますので、ご注意ください。　■平成18年1月（2006年1月）以降に生産された車両は、ローダウン時に「フォグランプ（前部霧灯）の下縁までの高さが250未満」および「ウインカー（方向指示器）の下縁までの高さが350未満」、「ヘッドライト（前照灯／ロービーム）の下縁までの高さが500未満」前述いずれかの場合、保安基準に抵触し車検不適合となりますので、現車の当該高さをご確認の上、装着してください。<br><br><br><br><br>対応車種：06/7～ RN6 ストリーム  2WD 1.8L <br><br>足回り | スプリング<br>ホンダ | ストリーム | RN6～9<tr><td colspan="2">
